    false,nt"url": null,nt"notes": "NODC accession 0104333 includes physical
    and underway data collected aboard the OCEANUS during cruise OC468-03 in the Gulf
    of Mexico and North Atlantic Ocean from 2010-09-18 to 2010-09-26. These data include
    CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT
    (V). The instruments used to collect these data include ADCP and GPS. These data
    were collected by Karen Grissom of US DOC; NOAA; NATIONAL WEATHER SERVICE; NATIONAL
    DATA BUOY CENTER, and by Woods Hole Oceanographic Institution as part of Deep-ocean
    Assessment and Reporting of Tsunamis (DART) Mooring. The Lamont-Doherty Earth Observatory
    (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling Deck to
    Repository (R2R) program. The ADCP data represent the raw and automated processed
    data set. Post processed quality assessed data are not available in this accession.",nt"owner_org":
